import './App.scss';
import Header from '../src/components/Header/Header.jsx'
import Routers from './Routers/index.jsx';
import { BrowserRouter as Router, Link, NavLink } from "react-router-dom";


function App() {

  return (
    <div className="App">
      <Router>

        <Header />

        <Routers />

        {/* footer */}

      </Router>
    </div>
  );
}

export default App;


